import "./Videoimage.scss"
function Videoimage({videoimage}) {
    return(

        <>
        <div className="videocontainer">
            <video className="videocontainer__video" poster={`${process.env.backendURL}/${videoimage}`} controls></video>
        </div>
        </>
    )
}

export default Videoimage
